    "Organochlorines and trace elements in avian pry of peregrine falcons in Colorado:
    Ten years after: First year interim report of a two year study",nt"tracking_summary":
    {ntt"total": 7,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:42:14.883713",nt"name": "organochlorines-and-trace-elements-in-avian-pry-of-peregrine-falcons-in-colorado-ten-years",nt"isopen":
    false,nt"url": null,nt"notes": "Bird species considered potential prey
    for peregrine falcons were collected at 10 sites in Colorado for analysis of organochlorine
    (OC) compounds and trace elements (TE). Migratory and non-migratory species representing
    insectivorous and omnivorous feeding habits were selected. Composite samples (7
    individuals/sample) of whole bodies excluding the gastrointestinal tract were analyzed
    for organochlorine compounds and composite liver samples (5 livers/sample) were
    analyzed for TEs. Of 22 different OC compounds, Dichlorodiphenyldichlorethylene
    (DDE) occurred most frequently (100%) and at the highest concentrations. None of
    the other OC compounds occurred frequently or at significant concentrations. Migratory
    species contained higher concentrations of DDE (Geometric Mean (GM)=0.75 ppm) than
    non-migratory species (GM=0.22 ppm) and insectivorous species (GM=1.44 ppm) were
    generally more contaminated than omnivorous species (GM=0.14 ppm). When compared
    to the results of an identical study done in 1980, DDE concentrations in migratory
    species declined by 2X but increased by 3X in non-migratory species and concentrations
    declined in both insectivorous and omnivorous species. The mean DDE concentration
    (0.62 ppm) over all species collected is less than the dietary level of 3 ppm DDE
    found to be harmful in other raptor species. Of 22 different TEs, only mercury and
    selenium occurred at concentrations of concern, both occurring in 100% of the samples
    collected. Swallow species and killdeer (migratory insectivores) contained the highest
    concentrations of mercury and selenium. The mean mercury concentration (GM=0.19)
    over all species collected is at lower end of the range of mercury concentrations
    considered to cause reproductive effects in some birds (0.176-0.352). The mean selenium
    concentration in liver samples (9.52 ppm) is above the dietary concentration of
    5 ppm selenium considered harmful to waterfowl and other birds. Potential TE dietary
    exposure (from consumption of whole birds) for peregrine falcons is unclear based
    on liver sample data reported here.",nt"license_title": "License Not Specified",nt"extras":
